To declare a component in Amethyst, you simply create a data structure (either a struct or an enum) that will hold the information that the component conveys, then you implement the Component trait for that data structure. use amethyst::ecs::{Component, DenseVecStorage}; // Type component
enum Type { Player, Monster, Building,
} impl Component for Type { type Storage = DenseVecStorage<Self>;
} // HP component
struct Hp { hp: u32,
} impl Component for Hp { type Storage = DenseVecStorage<Self>;
} Remember that each component has its own storage -- the type that you give type Storage tells Amethyst how you want to actually store those components in memory. There are a few different types of storage to choose from , but DenseVecStorage is a good default type to use if you don't have any good reasons to use something else. Usually, when you create an entity, you also give it any components that describe it. It'll end up looking something like this: world.create_entity() // Create a new entity .with(Type::Player) // Create a Type component, and associate it with this entity) .with(Hp{hp: 100}) // Create an HP component, and associate it with this entity) .build(); where "world" is the thing that keeps track of all your entities and components (and other things, which we'll see later).

