Before we can set any of those things up, though, we need some place in our code to actually initialize those objects, so that Amethyst's ECS framework knows about them. Amethyst states have a few different methods that run at different times and different intervals during the lifecycle of the state. Since we are forced to create an initial state to create an Application, we might as well use one of these methods to do the initialization work in. Since we only need to initialize our three entities once per game, the on_start method seems like a good place to do this. on_start runs only once when we enter that state, which is exactly what we need. // (other includes)
use amethyst::StateData;
use amethyst::GameData; struct GameState;
impl SimpleState for GameState { fn on_start(&mut self, state_data: StateData<'_, GameData<'_, '_>>) { // More code will go here }
} fn main() -> amethyst::Result<()> { // (...)
} When Amethyst calls on_start (or any of the other methods), it passes in some "state data" that you can use for context into the rest of the game (see StateData ). We don't really care about the lifetimes of the references inside the StateData for now, so we just use '_ to tell Rust "whatever you give us is fine with us". Since we will ultimately want to create entities within our game (to create our camera, lights, and spaceship), we are mostly concerned with the world field within StateData; this is the same world that I mentioned at the end of the last chapter.

