The first step is to create a camera, which allows us to see all the objects we crate in our game. To do this, we're going to use the Camera module from renderer. Let's make a brand new function called initialize_camera: // (other includes)
use amethyst::prelude::World;
use amethyst::renderer::Camera; // (GameState)
// (fn main) fn initialize_camera(world: &mut World) { world.create_entity() .with(Camera::standard_3d(1024.0, 768.0)) .build();
} Since we're making a 3D game, we're going to use standard_3d. 1024.0 and 768.0 are just the dimensions of our window, which we defined in our DisplayConfig. You can refactor that into some constants if you like; I'll do some refactoring in an upcoming chapter. The camera follows our standard entity and component setup I mentioned earlier: Create a nameless entity in our game world with world.create_entity() Add components to the entity; in this case, we're creating a Camera component and attaching it to this entity Build the entity to finalize everything and actually add it to the world So the camera is basically the same as any other entity/component you're going to make in your game; the only difference is that Camera does some magic rendering-related stuff in the background. Now, we need to hook that function up to our on_start method that we defined earlier: fn on_start(&mut self, state_data: StateData<'_, GameData<'_, '_>>) { initialize_camera(state_data.world);
} If you cargo run that right now, you won't notice any difference. That's because we don't have any shapes for the camera to view! Let's make one now.

17.body:
For now, we're just going to create a sphere so we understand what's going on. We'll modify it later to create the actual things in our game, like the spaceship and the cubes. Like the camera, the sphere is also going to be a standard entity with components. Let's just follow the same pattern as we did with the camera to create it. Create a new function called initialize_sphere: fn initialize_sphere(world: &mut World) { world.create_entity() .with( /*???*/ ) .build();
} Call this function in on_start: fn on_start(&mut self, state_data: StateData<'_, GameData<'_, '_>>) { initialize_camera(state_data.world); initialize_sphere(state_data.world);
} Now we need to figure out how to give the sphere a "shape" to be rendered. In PBR, we need two things for our object to be renderable: A mesh , which gives our object a shape in 3D space A material , which tells the rendering engine how to actually render that shape. In the next chapter I'll dive into these things with much more detail, but for now I'll just throw a blob of code at you. Mesh let mesh = world.exec(|loader: AssetLoaderSystemData<'_, Mesh>| { loader.load_from_data( Shape::Sphere(100, 100) .generate::<(Vec<Position>, Vec<Normal>, Vec<Tangent>, Vec<TexCoord>)>(None) .into(), (), )
}); Here we're generating the sphere mesh with Shape::Sphere(100, 100). There are a few basic shape generators to choose from , in case you want to mess around with your own shapes. The 100, 100 arguments are basically just the number of vertexes to generate the sphere with; more vertexes means a finer-"resolution" sphere. 100 is probably overkill, but it works for us. Material let material_defaults = world.read_resource::<MaterialDefaults>().0.clone();
let material = world.exec(|loader: AssetLoaderSystemData<'_, Material>| { loader.load_from_data( Material { ..material_defaults }, (), ) },
); We're basically generating a default material. We'll learn about materials and play around with them in the next chapter. Putting it all together We have a mesh, and we have a material. They can both be treated as components , so we can simply add them to the entity. world.create_entity() .with(mesh) .with(material) .build(); The full function should look like this: fn initialize_sphere(world: &mut World) { let mesh = world.exec(|loader: AssetLoaderSystemData<'_, Mesh>| { loader.load_from_data( Shape::Sphere(100, 100) .generate::<(Vec<Position>, Vec<Normal>, Vec<Tangent>, Vec<TexCoord>)>(None) .into(), (), ) }); let material_defaults = world.read_resource::<MaterialDefaults>().0.clone(); let material = world.exec(|loader: AssetLoaderSystemData<'_, Material>| { loader.load_from_data( Material { ..material_defaults }, (), ) }, ); world.create_entity() .with(mesh) .with(material) .build();
} Okay, we have a camera, and we have a renderable object. We don't have a light source yet, but we should still be able to see some shape, right? Let's cargo run the project and see what happens! blank screen Wait, what? Shouldn't we see a black sphere, at least? The problem turns out to be that the camera is effectively spawned inside the sphere, which means it won't render the sphere. We need to move stuff around in our scene for things to make sense.

