To move stuff around, we're going to use the TransformBundle. Let's add it to our GameDataBuilder: use amethyst::core::{Transform, TransformBundle}; let game_data = GameDataBuilder::default() .with_bundle(TransformBundle::new())? // other bundles Now, let's move our camera back a little bit so we can see the outside of the sphere. fn initialize_camera(world: &mut World) { let mut transform = Transform::default(); transform.set_translation_xyz(0.0, 0.0, 10.0); world.create_entity() .with(Camera::standard_3d(1024.0, 768.0)) .with(transform) .build();
} By default, the camera faces "downwards" in the negative Z direction. So if we move it "upwards" (positive Z) -- which is what we did with set_translation_xyz -- we should be able to see something sitting at (0.0, 0.0, 0.0). Transforms are treated as yet another component , so you can just attach them to your entity with with(). Finally, let's make sure the sphere is sitting at (0.0, 0.0, 0.0), and we should be able to see it. // ... let mut transform = Transform::default();
transform.set_translation_xyz(0.0, 0.0, 0.0); world.create_entity() .with(mesh) .with(material) .with(transform) .build(); black sphere Heeey, look at that. Pretty neat!

