The final thing we need to do for a "complete" PBR system is create a light source. You can think of this as a lightbulb or the sun -- light is generated from the source, and scatters out from the source. When light hits an object like our sphere, it bounces off that object in a bunch of different directions. Some of that light bouncing off the object will bounce towards our camera. Then, the camera picks it up and renders what it sees for us on the screen. (This is simplifying how things actually work in PBR quite a bit, but the concepts hold.) The shape's material affects how the light bounces off of it. You can change a whole bunch of stuff about the material, and the results will be a wide variety of changes to how the shape is rendered on screen. We'll explore materials in the next chapter. In our scene, the shape is blocking the background, so the renderer will draw something there. However, we don't have any light source to generate light to bounce off the shape, so the renderer will just render it as 100% black. Our choice of a light blue clear color makes the scene above a little unintuitive: there's actually no "light" coming from the background, it's just what we draw if we have nothing else to render. It would make a little more sense if we chose a black clear color, but whatever; let's just create a light source and see what happens! Like the camera and the sphere, the light source is just another ordinary entity with some components attached. use amethyst::renderer::light::{Light, PointLight};
use amethyst::renderer::palette::rgb::Rgb; fn initialize_light(world: &mut World) { let light: Light = PointLight { intensity: 10.0, color: Rgb::new(1.0, 1.0, 1.0), ..PointLight::default() }.into(); let mut transform = Transform::default(); transform.set_translation_xyz(5.0, 5.0, 20.0); world .create_entity() .with(light) .with(transform) .build();
} The Light component is a PointLight, with intensity 10.0 and a completely white hue. We're moving the light behind the camera (20.0 in the Z direction), and a little off-center. Now, just add it to the game: struct GameState;
impl SimpleState for GameState { fn on_start(&mut self, state_data: StateData<'_, GameData<'_, '_>>) { initialize_camera(state_data.world); initialize_sphere(state_data.world); initialize_light(state_data.world); }
} shaded sphere Now it actually looks like a sphere.

