The API reference describes the Application object pretty well: An Application is the root object of the game engine. It binds the OS event loop, state machines, timers and other core components in a central place. Since Application functions as the root of the game, Amethyst does not need to use any global variables. Within this object is everything that your game needs to run. Every Amethyst game creates an Application, so that seems like a good place to start. In order to create an Application, we first have to create a few bits of information that it depends on: A PathBuf to an assets directory An initial State to start the game in A GameDataBuilder object; GameData holds a bunch of game logic and other stuff that your game needs during runtime. Assets directory First, we need to create a PathBuf that represents an assets directory. Assets are anything that your game loads before/during game runtime -- things like 3D models, textures, audio, sprites, etc. Pretty much any game of any substantial size will have an assets directory... but we won't need to have one for quite a while in this tutorial! Let's just give it a sane directory name (assets) for now, and I'll describe how assets work when we start using them. use amethyst::utils::application_root_dir; fn main() -> amethyst::Result<()> { // (logger) // Set up the assets directory (PathBuf) let app_root = application_root_dir()?; let assets_dir = app_root.join("assets"); Ok(())
} By the way, you don't actually need to create the assets/ directory now (in the root directory of your project, at the same level as src/), but you can if you want. Create an initial State Amethyst has a neat style of state management built-in called a "pushdown automaton", which you can read a little more about on Wikipedia and Amethyst's wiki page . It's a little different than the (maybe?) more-common " finite-state machine ", but pushdown automatons are a little more powerful. Regardless, we won't be needing the features of the state management system quite yet. Simple games like this can have just one main "game" state; once you want to start implementing main menus, pause menus, etc, then you'll probably want to start reaching for state management. Let's just satisfy Application for now. The easiest way to create a State in Amethyst is to define a unit struct and implement the SimpleState trait for it: // (other includes)
use amethyst::SimpleState; struct GameState;
impl SimpleState for GameState {} fn main() -> amethyst::Result<()> { // (...)
} Create a GameDataBuilder GameData is the "central repository" for a bunch of stuff your game needs during runtime, and GameDataBuilder is a convenient way to build it. For now, we don't need anything in the GameData, so we can just create a builder with nothing in it. We'll be adding stuff to it very soon (before the end of this chapter, even). // (other includes)
use amethyst::GameDataBuilder; // (GameState) fn main() -> amethyst::Result<()> { // (logger) // (assets directory) // Set up an empty (for now) GameDataBuilder let game_data = GameDataBuilder::default(); Ok(())
} Create an Application, and run our game! We're finally ready to create an Application! // (other includes)
use amethyst::Application; // (GameState) fn main() -> amethyst::Result<()> { // (logger) // (assets directory) // (GameDataBuilder) // Run the game! let mut game = Application::new(assets_dir, GameState, game_data)?; game.run(); Ok(())
} Go ahead and cargo run this to make sure everything's working. You should just see a few log messages print out before Amethyst dumps you into an infinite loop. Ctrl+C.

