Alright, now we need a window for our game. To do this, we're going to bring in a " Bundle " that implements a lot of the stuff for us. In general, you can think of bundles as a cross-section of game functionality that implements some feature for you. It's possible to (and you will likely want to eventually) create your own bundles, but that's a bit far away for now. In particular, we're going to be using the RenderingBundle here, which (along with some bundle plugins) implements a bunch of rendering stuff for us, including window creation itself. // (other includes)
use amethyst::renderer::plugins::RenderPbr3D;
use amethyst::renderer::plugins::RenderToWindow;
use amethyst::renderer::types::DefaultBackend;
use amethyst::renderer::RenderingBundle;
use amethyst::window::DisplayConfig; // (GameState) fn main() -> amethyst::Result<()> { // (logger) // (assets directory) // Set up the display configuration let display_config = DisplayConfig { title: "Amethyst".to_string(), dimensions: Some((1024, 768)), ..Default::default() }; // Set up the GameDataBuilder let game_data = GameDataBuilder::default() .with_bundle( RenderingBundle::<DefaultBackend>::new() .with_plugin( RenderToWindow::from_config(display_config) .with_clear([0.529, 0.808, 0.98, 1.0]), ) .with_plugin(RenderPbr3D::default()), )?; // (Application) Ok(())
} That's a lot of new code, so let's break it down line-by-line. The DisplayConfig is what will eventually get used by the RenderToWindow plugin to set up our window for us. Here we're setting the window's title and dimensions explicitly, then using the defaults for every other field in the struct. We already had GameDataBuilder before, but now we're adding a bundle to it. with_bundle is the function you use to add a bundle. RenderingBundle is the bundle we're using to set up rendering. As far as bundles go, RenderingBundle is a pretty complex one: it delegates most of its work to plugins, which lets the user set up their rendering system as they see fit. It's also parameterized on a "Backend", but since you set up your rendering backend in Cargo.toml, you can just use DefaultBackend here. Since RenderingBundle delegates most of its work to plugins, we need to give it some plugins. with_plugin is the function you use to add plugins, at least for RenderingBundle. The first plugin we're using is RenderToWindow, which sets up a window for us and allows us to draw to it. You have to supply a DisplayConfig for it to use, which is what we did up above. We're also specifying a "clear value", which is what the renderer uses as a "background" to your game when there was nothing in front of it to render. The format for the color is [Red, Green, Blue, Alpha]. You'll probably want to set alpha to 1.0, and the rest of the colors are up to you. Here I made light sky-blue color. If you don't specify a clear value, the renderer won't clear the screen, just drawing over the last frame directly. It'll look similar to the classic Windows lagging graphics glitch . Try commenting that line of code out when you have more of a game to work with! The second plugin is RenderPbr3D, which is a Physically Based Rendering engine that we'll be using for rendering our game. Go ahead and cargo run that. You should get a blank window, filled with whatever your clear color is.
